import ProjectsPage from "../pages/Projects/ProjectsPage";
import CVPage from "../pages/CV/CVPage";

const acessiblePages = [
    {name: 'Meus Projetos', toLink: '/meus-projetos', Element: ProjectsPage},
    {name: 'Meu Currículo', toLink: '/meu-curriculo', Element: CVPage}
];

export default acessiblePages;
